import Footer from "../component/Footer";
import { Title } from "@mui/icons-material";

const Container = styled.div`
    
`;


const Product = () => {
  return (
        <Container>
            <Navbar />
            <Announcement/>
            <Wrapper>
                <ImgContainer>
                </ImgContainer>
                <InfoContainer>
                    <Title>

                    </Title>
                    <Desc>
                        
                    </Desc>
                </InfoContainer>


            </Wrapper>
            <Newsletter/>
            <Footer/>
        </Container>
    )
}

export default Product
